import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import Sdata from './Sdata';

ReactDOM.render(
    <>
    {Sdata.map((value) =>{
        return(
        <Card 
        key={value.id}
        imagesrc={value.imagesrc}
        title={value.title}
        sname={value.sname}
        link={value.link} 
        />
        );

    })}


        </>,
   document.getElementById('root')
);
